import React, { Component } from "react";

export default class Counter extends Component {
  render() {
    const App = {
      width: "10%",
      margin: "0 auto",
    };

    return (
      <div style={App}>
        <button>-</button>
        <span>{this.initialCounter}</span>
        <button>+</button>
      </div>
    );
  }
}
